const CTableBody = (props) => {
  return (
    <>
      {props.body.map((row, i) => {
          return(
            <tr key={i}>
            <td>{row.id}</td>
            <td>{row.itemname}</td>
            <td>{row.itemcode}</td>
            <td>{row.count}</td>
            <td>{row.updated_at}</td>
          </tr>
          );
       
      })}
    </>
  );
};
export default CTableBody;

